function exist(elem) {
  (elem.length>0) ? true : false;
}
function randd(min, max) {
  return Math.floor(arguments.length > 1 ? (max - min + 1) * Math.random() + min : (min + 1) * Math.random());
};
// перемешивание
function shuffle(o){
    for(var j, x, k = o.length; k; j = Math.floor(Math.random() * k), x = o[--k], o[k] = o[j], o[j] = x);
    return o;
};
function getFr(a, n){
  var tmp = a.length;
  var ret='';
  if (n == undefined) {
    n = tmp>10?10:tmp/2;
    n = n<1?1:n;
  }
  tmp=0;
  for (var slog in a) {
    ret = a[slog].fr>tmp?a[slog].slog:ret;
  }
  return ret;
}
function getSim(slog, a, sim) {
  var ret = '';
  var tmp_fr=0;
  var maxTry=10;
  if (sim == undefined) {
    sim = slog-1;
  }
  if (sim<1)
    sim=1;

  for (var i=0; i<a.length; i++) {
    /**/
    var sl1 = a[i].slog.substr(-sim);
    var sl2 = slog.substr(0, sim);

    if (sl1 == sl2  &&
        a[i].fr > tmp_fr &&
        maxTry>0) {
      ret=a[i].slog.substr(0, a[i].slog.length-sim);
      maxTry--;
      tmp_fr = a[i].fr;
    }
    /**/

  }
  return ret;
}
