function generate_word(source) {
  var maxLength = randd(0,4);
	var name = getFr(shuffle(source.end));

  for (var q=0; q<maxLength; q++) {
    sh = shuffle(source.mid)
    name = getSim(name, sh, 2) + name;
  }
  sh = shuffle(source.st)
  name = fixName(getSim(name, sh, 2) + name);
  return name;
}
function make_name2(src, race, subrace) {
  var name = '';
	
	for (var t1 in src.l) {
		if(src.l[t1].name == race){
			for (var t2 in src.l[t1].list) {
				if (src.l[t1].list[t2].name == subrace) {
					var cur = src.l[t1].list[t2];
					var schemes = cur.schemes;
					var schema = schemes[0, schemes.length-1];
					var name_arr = schema.split(" ");
					var source = cur.src;
					for (var i in name_arr) {
						for( var j in source) {
							if(source[j].name==name_arr[i]) {
								name+= fixName(generate_word(source[j]))+" ";
								break;
							}
						}
					}					
						
					break;
				}
			}
			break;
		}
	}
	

	
  return name;
}

